plot


Night at the Museum 2006:

In New York, unemployed and divorced Larry Daley is a complete loser. His son Nick is very disappointed with his father who is going to be evicted. Larry accepts the job of night watchman in the Museum of Natural History and takes the place of three old security guards that have just retired in order to raise some money and pay his bills. On his first shift, Larry soon realizes that everything at the museum is not as it seems as the statues begin to come to life after the sun sets. The Museum transforms into complete chaos with the inexperienced Larry in charge as he learns that an old Egyptian stone that came to the Museum in 1950 brings these statues to life until dawn. When Larry brings his son to spend a night with him, the three old guards break into the Museum to try to steal the magical stone. Larry organizes all the historic characters to help him stop the criminals and save the museum.


Night at the Museum: Battle of the Smithsonian 2009:

Ben Stiller returns as Larry Daley, the unfortunate night watchman who continues to encounter living and breathing museum exhibits in Night at the Museum 2: Escape From the Smithsonian, 20th Century Fox's tent-pole sequel from director Shawn Levy. Scott Frank, Robert Ben Garant, and Thomas Lennon provide the script, with Chris Columbus returning to handle producing duties. Amy Adams (Enchanted) and Hank Azaria join the returning cast of Robin Williams, Ricky Gervais, and Owen Wilson in the 1492 and 21 Laps Entertainment co-production.

Night at the Museum: Secret of the Tomb 2014:

At the Museum of Natural History, there's new exhibit being unveiled. Larry Daley who manages the night exhibit because the exhibits come to life because of the Tablet of Ahkmenrah, is in charge of the presentation. But when the exhibits go wild, Larry finds himself in trouble. He learns that the Tablet is corroding so he does some research and learns that Cecil, the former museum guard was at the site when the Tablet was discovered. He tells Larry that they were warned that if they remove it could mean the end. Larry realizes it means the end of magic. He talks to Ahkmenrah who says that he doesn't know anything. Only his father the Pharoah knows the Tablet's secrets. He learns that the Pharoah was sent to the London museum. So he convinces, Dr. McPhee the museum curator to help send him to London. He goes and takes Ahkmenrah with him but some of the others like Teddy Roosevelt, Attila, Octavius, and Jedediah come with him.

